import React from "react";
import Layout from "../Layout";

const Index = () => {
  return (
    <Layout pageTitle="Realtime Geofencing">
      <main className="container-fluid position-absolute h-100 bg-light">
        <div className="row position-absolute w-100 h-100">
          <section className="col-md-2 position-relative d-flex flex-wrap h-100 align-items-start align-content-between bg-white px-0"></section>

          <section className="col-md-8 px-0 border-right border-left border-gray position-relative h-100"></section>

          <section className="col-md-2 position-relative d-flex flex-wrap h-100 align-items-start align-content-between bg-white px-0"></section>
        </div>
      </main>
    </Layout>
  );
};

export default Index;
